import React from "react";

import Books from "../lists/Books";
import Ebooks from "../lists/Ebooks";
import Borrowed from "../lists/Borrowed";
import Wishlist from "../lists/Wishlist";

export default function Main() {

    return(
        <>
            <div className="books-container">
                <button className="boooks" onClick={Books}><img src="../images/books.svg" alt="książki"/></button>
                <h2>książki</h2>
                <p>sprawdź, co już masz na papierze</p>
            </div>
            <div className="books-container">
                <button className="ebooks" onClick={Ebooks}><img src="../images/kindle.png" alt="ebooki"/></button>
                <h2>ebooki</h2>
                <p>sprawdź, co już masz na kindlu</p>
            </div>
            <div className="borrowed-container">
                <button className="ebooks" onClick={Borrowed}><img src="../images/kindle.png" alt="wypożyczone"/></button>
                <h2>wypożyczone</h2>
                <p>zapisz, żeby nie zapomnieć</p>
            </div>
            <div className="wishlist-container">
              <a href="../lists/Wishlist.js"><img src="../images/heart.png" alt="wishlist"/></a>
                <h2>wishlist</h2>
                <p>zapamiętaj, co chcesz kupić</p>
            </div>
        </>
    )
};
